import React from 'react';


function Footer() {
    return (
        <div className="footer">
            Follow us
            <ul> 
                <a href="https://www.instagram.com/chester.cervantes/">
                    <img src="glyph-logo_May2016.png" style="width:128px;height:128px;"/>
                </a> 
            </ul>
        </div>
    );
}

export default Footer;
